import styled from 'styled-components';

export const Header = styled.header`
  display: flex;
  justify-content: center;
  background-color: #fff;
  position: sticky;
  height: 100px;
  top: 0;
  box-shadow: 4px 4px 20px 2px rgba(144, 137, 130, 0.3);
`;
